import React from "react";
import Navbar from "../../components/LandingPageComponents/Navbar";
import img1 from "../../assets/img1.png";
import mid from "../../assets/mid.png";
import img3 from "../../assets/img3.png";
import ImageButton from "../../components/LandingPageComponents/ImageButton";
import MiButton from "../../components/LandingPageComponents/ImageButton";
import "../../components/LandingPageComponents/button.css"

const HomePage = () => {
    return (
      <div className="mainContainer" style={{backgroundColor: "#FFFFFF"}}>
        {/** Navbar */}
        <div>
            <Navbar />
        </div>

         {/** First background image */}
        <div className="img1" style={{}}>
            <img src={img1} alt="" />
        </div>

        <div>
            <div>
                <p>
                    You can learn<br />
                    anything,<br />
                    anywhere.<br />
                </p>
            </div>
            <div>
                <p>
                    Education is the process of facilitating learning, or the acquisition of<br />
                    knowledge, skills, values, beliefs and habits.
                </p>
            </div>
            <div>
                {/* <ImageButton text={"Get Started"} /> */}
                <button className="botn2">Get started</button>
            </div>
        </div>

         {/** second background image */}
        <div className="middle" style={{}}>
            <div style={{
                height: "16px", 
                background: "#21334F"
                }}>
                <img src={mid} alt="" />
            </div>
            <div style={{
                color: "#FFFFFF",
                fontSize: "40px",
                width: "623px",
                height: "48px",
                paddingLeft: '15rem'
            }}>
                {/* <p>Trusted by over 1,500 Students</p> */}
            </div>
            <div>
                {/* <MiButton text={"Get started"} /> */}
                {/* <button className="botn3">Get Started</button> */}
            </div>
        </div>

             {/** last image */}
            <div>
                <img src={img3} alt="" />
            </div>

            {/** second to the last div */}
            <div style={{
                backgroundColor: "white",
                height: "20rem"
            }}>
                <h1 className="header" style={{
                    textAlign: "center",
                    paddingTop: "3rem"
                }}>Our Partners</h1>
            </div>

             {/** last div */}
            <div style={{
                backgroundColor: "#000000",
                height: "15rem"
            }}>
                <h1 className="header" style={{
                    textAlign: "center",
                    paddingTop: "2rem",
                    color: "#FFFFFF"
                }}>Scorecard</h1>
            </div>
            <div>
                <ol style={{
                }}>
                    <li><a href="">Home</a></li>
                    <li><a href="">About</a></li>
                    <li><a href="">Learnings</a></li>
                    <li><a href="">Contact</a></li>
                </ol>
            </div>

      </div>
    )
}

export default HomePage;
